menu={};$.getJSON("js/menu_items.json",function(a){menu=a}).done(function(){var a=$("#menuBody");$.each(menu,function(b,c){a.append('<div class="row"> <div class="col-md-8"><h2 class="category tiki" id="'+b+'">'+b+"</h2> </div></div>");$.each(c,function(d,e){var f="";$.each(e,function(g,h){f=g===0?f+h.Ingredient:f+", "+h.Ingredient});a.append(' <div class="drinkrow row"><div class="col-md-8"><h4 class="drinkname">'+d+'</h4><p class="card-text desc"> '+f+"  </p></div></div>")})})});